    def is_valid_grammar(grammar):
        try:
            return parse_grammar(grammar)
        except Exception as e:
            print(f"Error parsing grammar: {e}")
            return False

    def parse_grammar(grammar):
        grammar_string = grammar

        # Extract the start symbol
        start_symbol = grammar_string[0]

        # Extract the production rules
        rules = grammar_string[1:]

        # Build a dictionary to store the rules
        rules_dict = {}

        # Iterate through the rules and add them to the dictionary
        for rule in rules:
            rule_string = rule.strip()

            if not rule_string:
                continue

            # Parse the rule
            rule_parts = rule_string.split()

            if len(rule_parts) == 1:
                # This is a production rule
                rules_dict[rule_parts[0]] = rule_parts[1]
            elif len(rule_parts) == 2:
                # This is a production rule with two parts
                rule_parts_1 = rule_parts[0]
                rule_parts_2 = rule_parts[1]

                if rule_parts_1 == "NT" and rule_parts_2 == "NT":
                   rules_dict[rule_parts_1] = rule_parts_2
                elif rule_parts_1 == "NT" and rule_parts_2 == "NT7":
