                elif rule_parts_1 == "NT" and rule_parts_2 == "NT21":
                   rules_dict[rule_parts_1] = rule_parts_2

        return rules_dict

    grammar = parse_grammar(s)

    if grammar:
        return is_valid_grammar(grammar)
    else:
        return 'No'

